"use strict";(self.webpackChunkunityquest_chronicles_of_love=self.webpackChunkunityquest_chronicles_of_love||[]).push([[1007],{49699:(e,t,n)=>{n.r(t),n.d(t,{default:()=>o,johnChapter7PL:()=>i});const i={chapter:7,title:"Jean 7",version:"Gda\u0144sk Bible 1632",language:"pl",direction:"ltr",verses:[{number:1,text:"I chodzi\u0142 Jezus potem po Galilei; bo nie chcia\u0142 chodzi\u0107 po \u017bydowskiej ziemi, przeto i\u017c go \u017bydowie szukali zabi\u0107.",strong:[{text:"faire",strong:"G1080",start:120,end:125}]},{number:2,text:"A by\u0142o blisko \u015bwi\u0119to \u017bydowskie Kuczek.",strong:[]},{number:3,text:"I rzekli do niego bracia jego: Wynijd\u017a st\u0105d, a id\u017a do Judzkiej ziemi, aby i uczniowie twoi ogl\u0105dali sprawy twoje, kt\xf3re czynisz.",strong:[]},{number:4,text:"Albowiem \u017caden nie czyni czego potajemnie, a sam si\u0119 chce pokaza\u0107 jawnie; je\u017ali to czynisz, oka\u017c si\u0119 \u015bwiatu.",strong:[{text:"Personne",strong:"G3762",start:0,end:8},{text:"monde",strong:"G2889",start:100,end:105}]},{number:5,text:"(Bo i bracia jego nie wierzyli we\u0144.)",strong:[]},{number:6,text:"Tedy im rzek\u0142 Jezus: Jeszcze nie przyszed\u0142 czas m\xf3j, ale czas wasz zawsze jest got\xf3w.",strong:[{text:"toujours",strong:"H5769",start:70,end:78}]},{number:7,text:"Nie mo\u017ce \u015bwiat was mie\u0107 w nienawi\u015bci, ale mnie ma w nienawi\u015bci; bom ja \u015bwiadczy o nim, \u017ce sprawy jego z\u0142e s\u0105.",strong:[{text:"monde",strong:"G2889",start:3,end:8}]},{number:8,text:"Wy id\u017acie na to \u015bwi\u0119to; ja jeszcze nie id\u0119 na to \u015bwi\u0119to, bo czas m\xf3j jeszcze si\u0119 nie wype\u0142ni\u0142.",strong:[{text:"cette",strong:"G3778",start:16,end:21},{text:"cette",strong:"G3778",start:65,end:70}]},{number:9,text:"A to im powiedziawszy, zosta\u0142 w Galilei.",strong:[{text:"avoir",strong:"G1372",start:11,end:16}]},{number:10,text:"A gdy wyjechali bracia jego, tedy i on wyszed\u0142 na ono \u015bwi\u0119to, nie jawnie, ale jakoby potajemnie.",strong:[{text:"comme",strong:"G2531",start:94,end:99}]},{number:11,text:"Tedy go \u017bydowie szukali w ono \u015bwi\u0119to, i m\xf3wili: Gdzie\u017c on jest?",strong:[]},{number:12,text:"I by\u0142o wielkie szemranie o nim mi\u0119dzy ludem; bo jedni m\xf3wili, \u017ce dobry jest; a drudzy m\xf3wili: Nie, ale zwodzi lud.",strong:[{text:"dans",strong:"H6887",start:11,end:15},{text:"foule",strong:"G3793",start:19,end:24},{text:"homme",strong:"G444",start:79,end:84},{text:"bien",strong:"H2896",start:88,end:92},{text:"multitude",strong:"G3793",start:130,end:139}]},{number:13,text:"Wszak\u017ce \u017caden jawnie o nim nie m\xf3wi\u0142 dla boja\u017ani \u017bydowskiej.",strong:[{text:"Personne",strong:"G3762",start:0,end:8}]},{number:14,text:"A gdy ju\u017c by\u0142o w po\u0142owie \u015bwi\u0119ta, wszed\u0142 Jezus do ko\u015bcio\u0142a, i naucza\u0142.",strong:[]},{number:15,text:"I dziwowali si\u0119 \u017bydowie, m\xf3wi\u0105c: Jako\u017c ten umie Pisma, nie ucz\u0105c si\u0119?",strong:[]},{number:16,text:"Odpowiedzia\u0142 im Jezus i rzek\u0142: Nauka moja nie jest moja, ale tego, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[]},{number:17,text:"Je\u017aliby kto chcia\u0142 wol\u0119 jego czyni\u0107, pozna t\u0119 nauk\u0119, je\u017ali jest z Boga, czyli ja sam od siebie m\xf3wi\u0119.",strong:[{text:"faire",strong:"G1080",start:18,end:23},{text:"Dieu",strong:"G2316",start:71,end:75}]},{number:18,text:"Kto od siebie m\xf3wi, chwa\u0142y swojej szuka; ale kto szuka chwa\u0142y tego, kt\xf3ry go pos\u0142a\u0142, ten jest prawdziwy, a niesprawiedliwo\u015bci w nim niemasz.",strong:[{text:"propre",strong:"G2398",start:39,end:45},{text:"injustice",strong:"G93",start:151,end:160}]},{number:19,text:"Aza\u017c wam Moj\u017cesz nie da\u0142 zakonu? a \u017caden z was nie wype\u0142nia zakonu. Czemu\u017c mi\u0119 szukacie zabi\u0107?",strong:[{text:"faire",strong:"G1080",start:100,end:105}]},{number:20,text:"Odpowiedzia\u0142 lud i rzek\u0142: Dyjabelstwo masz; kt\xf3\u017c ci\u0119 szuka zabi\u0107?",strong:[{text:"foule",strong:"G3793",start:3,end:8},{text:"faire",strong:"G1080",start:63,end:68}]},{number:21,text:"Odpowiedzia\u0142 Jezus i rzek\u0142 im: Jedn\u0119 spraw\u0119 uczyni\u0142em, a wszyscy si\u0119 dziwujecie.",strong:[]},{number:22,text:"Przeto\u017c Moj\u017cesz da\u0142 wam obrzezanie, (nie \u017ce jest z Moj\u017cesza, ale z ojc\xf3w,) a w sabat obrzezujecie cz\u0142owieka.",strong:[{text:"homme",strong:"G444",start:122,end:127},{text:"jour",strong:"H3117",start:131,end:135}]},{number:23,text:"Je\u017ali cz\u0142owiek bierze obrzezanie w sabat, aby nie by\u0142 z\u0142amany zakon Moj\u017cesz\xf3w, czemu\u017c si\u0119 na mi\u0119 gniewicie, \u017cem ca\u0142ego cz\u0142owieka uzdrowi\u0142 w sabat?",strong:[{text:"homme",strong:"G444",start:6,end:11},{text:"jour",strong:"H3117",start:38,end:42},{text:"contre",strong:"G2596",start:126,end:132},{text:"homme",strong:"G444",start:161,end:166},{text:"tout",strong:"G3956",start:167,end:171},{text:"jour",strong:"H3117",start:182,end:186}]},{number:24,text:"Nie s\u0105d\u017acie wed\u0142ug osoby, ale sprawiedliwy s\u0105d s\u0105d\u017acie.",strong:[{text:"selon",strong:"G2531",start:13,end:18},{text:"selon",strong:"G2531",start:43,end:48},{text:"justice",strong:"G2920",start:52,end:59}]},{number:25,text:"Tedy niekt\xf3rzy z Jeruzalemczyk\xf3w m\xf3wili: Aza\u017c to nie jest ten, kt\xf3rego szukaj\u0105 zabi\u0107?",strong:[{text:"faire",strong:"G1080",start:83,end:88}]},{number:26,text:"A oto jawnie m\xf3wi, a nic mu nie m\xf3wi\u0105; aza\u017c prawdziwie poznali ksi\u0105\u017c\u0119ta, \u017ce ten jest prawdziwie Chrystus?",strong:[{text:"rien",strong:"G3762",start:51,end:55},{text:"Christ",strong:"G5547",start:117,end:123}]},{number:27,text:"Wszak\u017ce wiemy sk\u0105d ten jest; ale gdy przyjdzie Chrystus, \u017caden nie b\u0119dzie wiedzia\u0142, sk\u0105d jest.",strong:[{text:"Christ",strong:"G5547",start:53,end:59},{text:"personne",strong:"G3762",start:79,end:87}]},{number:28,text:"Tedy wo\u0142a\u0142 Jezus, nauczaj\u0105c w ko\u015bciele i m\xf3wi\u0105c: I znacie mi\u0119, i wiecie, sk\u0105d jestem; a nie przyszed\u0142em sam od siebie, ale prawdziwy jest, kt\xf3ry mi\u0119 pos\u0142a\u0142, kt\xf3rego wy nie znacie.",strong:[{text:"enseignant",strong:"G1320",start:10,end:20},{text:"dans",strong:"H6887",start:21,end:25}]},{number:29,text:"Ale ja go znam; bo od niego jestem, a on mi\u0119 pos\u0142a\u0142.",strong:[]},{number:30,text:"Tedy go szukali pojma\u0107, ale \u017caden na\u0144 r\u0119ki nie w\u0142o\u017cy\u0142; bo jeszcze nie by\u0142a przysz\u0142a godzina jego.",strong:[{text:"personne",strong:"G3762",start:44,end:52},{text:"main",strong:"G5495",start:63,end:67}]},{number:31,text:"A wiele z ludu uwierzy\u0142o we\u0144, i m\xf3wili: Chrystus gdy przyjdzie, aza\u017c wi\u0119cej znak\xf3w uczyni, ni\u017c ten czyni\u0142?",strong:[{text:"foule",strong:"G3793",start:19,end:24},{text:"Christ",strong:"G5547",start:61,end:67}]},{number:32,text:"S\u0142yszeli Faryzeuszowie, \u017ce lud o nim tak szemra\u0142; i pos\u0142ali Faryzeuszowie i przedniejsi kap\u0142ani s\u0142ugi, aby go pojmali.",strong:[{text:"foule",strong:"G3793",start:30,end:35}]},{number:33,text:"Tedy rzek\u0142 im Jezus: Jeszcze maluczki czas z wami jestem, a potem id\u0119 do tego, kt\xf3ry mi\u0119 pos\u0142a\u0142.",strong:[{text:"avec",strong:"G1848",start:26,end:30}]},{number:34,text:"Szuka\u0107 mi\u0119 b\u0119dziecie, a nie znajdziecie, a gdzie ja b\u0119d\u0119, tam wy przyj\u015b\u0107 nie mo\u017cecie.",strong:[]},{number:35,text:"I m\xf3wili \u017bydowie mi\u0119dzy sob\u0105: Gdzie\u017c ten p\xf3jdzie, \u017ceby\u015bmy go nie mieli znale\u017a\u0107? Aza\u017c do rozproszonych mi\u0119dzy pogany p\xf3jdzie, a b\u0119dzie naucza\u0142 pogan?",strong:[]},{number:36,text:"C\xf3\u017c to jest za s\u0142owo, kt\xf3re rzek\u0142: Szuka\u0107 mi\u0119 b\u0119dziecie, a nie znajdziecie, a gdzie ja b\u0119d\u0119, tam wy przyj\u015b\u0107 nie mo\u017cecie?",strong:[{text:"cette",strong:"G3778",start:13,end:18},{text:"parole",strong:"G3056",start:19,end:25}]},{number:37,text:"A w on ostatni wielki dzie\u0144 \u015bwi\u0119ta sta\u0142 Jezus i wo\u0142a\u0142, m\xf3wi\u0105c: Je\u017ali kto pragnie, niechaj przyjdzie do mnie, a pij.",strong:[{text:"jour",strong:"H3117",start:11,end:15},{text:"grand",strong:"G3173",start:20,end:25},{text:"jour",strong:"H3117",start:26,end:30},{text:"soif",strong:"G1372",start:92,end:96}]},{number:38,text:"Kto wierzy we mnie, jako m\xf3wi Pismo, rzeki z \u017cywota jego pop\u0142yn\u0105 wody \u017cywej.",strong:[{text:"comme",strong:"G2531",start:70,end:75}]},{number:39,text:"(A to powiedzia\u0142 o Duchu, kt\xf3rego mieli wzi\u0105\u0107 wierz\u0105cy we\u0144; bo jeszcze nie by\u0142 dan Duch \u015awi\u0119ty, przeto \u017ce Jezus jeszcze nie by\u0142 uwielbiony.)",strong:[{text:"Esprit",strong:"G4151",start:17,end:23},{text:"recevoir",strong:"G3880",start:37,end:45},{text:"Esprit",strong:"G4151",start:80,end:86}]},{number:40,text:"Tedy wiele z ludu us\u0142yszawszy t\u0119 mow\u0119, m\xf3wili: Ten jest prawdziwie on prorok.",strong:[{text:"foule",strong:"G3793",start:15,end:20}]},{number:41,text:"Inni m\xf3wili: Ten jest Chrystus. A drudzy m\xf3wili: Aza\u017c z Galilei przyjdzie Chrystus?",strong:[{text:"Christ",strong:"G5547",start:28,end:34},{text:"bien",strong:"H2896",start:65,end:69},{text:"Christ",strong:"G5547",start:102,end:108}]},{number:42,text:"Aza\u017c Pismo nie m\xf3wi, \u017ce z nasienia Dawidowego, i z miasteczka Betlehem, gdzie by\u0142 Dawid, przyjdzie Chrystus?",strong:[{text:"Christ",strong:"G5547",start:114,end:120}]},{number:43,text:"A tak powsta\u0142o rozerwanie mi\u0119dzy ludem dla niego.",strong:[{text:"foule",strong:"G3793",start:49,end:54}]},{number:44,text:"A niekt\xf3rzy z nich chcieli go pojma\u0107, ale \u017caden na\u0144 r\u0105k nie w\u0142o\u017cy\u0142.",strong:[{text:"personne",strong:"G3762",start:51,end:59},{text:"main",strong:"G5495",start:70,end:74}]},{number:45,text:"I przyszli s\u0142udzy do przedniejszych kap\u0142an\xf3w i do Faryzeusz\xf3w, a oni rzekli im: Czemu\u015bcie go nie przywiedli?",strong:[{text:"amen",strong:"G281",start:139,end:143}]},{number:46,text:"Odpowiedzieli oni s\u0142udzy: Nigdy tak nie m\xf3wi\u0142 cz\u0142owiek, jako ten cz\u0142owiek.",strong:[{text:"homme",strong:"G444",start:34,end:39},{text:"comme",strong:"G2531",start:50,end:55},{text:"homme",strong:"G444",start:60,end:65}]},{number:47,text:"Odpowiedzieli im Faryzeuszowie: Aza\u017c i wy jeste\u015bcie zwiedzieni?",strong:[]},{number:48,text:"Aza\u017c kto z ksi\u0105\u017c\u0105t albo z Faryzeusz\xf3w uwierzy\u0142 we\u0144?",strong:[]},{number:49,text:"Ale ten lud, kt\xf3ry nie zna zakonu, przekl\u0119ty jest.",strong:[{text:"cette",strong:"G3778",start:5,end:10},{text:"foule",strong:"G3793",start:11,end:16}]},{number:50,text:"Rzek\u0142 do nich Nikodem, (ten, kt\xf3ry przyszed\u0142 do niego w nocy,) b\u0119d\u0105c jeden z nich:",strong:[{text:"nuit",strong:"G3571",start:28,end:32}]},{number:51,text:"Aza\u017c zakon nasz s\u0105dzi cz\u0142owieka, je\u017ali pirwej nie wys\u0142ucha od niego, a nie wie, co czyni?",strong:[{text:"homme",strong:"G444",start:29,end:34}]},{number:52,text:"Odpowiedzieli i rzekli mu: Aza\u017c i ty z Galilei jeste\u015b? Szukaj, a obacz, \u017ce prorok z Galilei nie powsta\u0142.",strong:[]},{number:53,text:"I rozeszli si\u0119 ka\u017cdy do domu swego.",strong:[{text:"dans",strong:"H6887",start:24,end:28},{text:"maison",strong:"G3609",start:32,end:38}]}]},o=i}}]);
